import "./producten.css";

const ProductenCollectie = ({image}) => {
    return(
        <article className="ProductenCollectie">
            <figure className="ProductenCollectie__figure">
                <img src={image} className="ProductenCollectie__figure"/>
            </figure>
        </article>
    )
}

export default ProductenCollectie;
